import '../App.css';
import Cabeza from "../componentes/Cabeza";
import Pie from "../componentes/Pie";
import BFantasmas from "../componentes/BFantasmas";
import Contenido from "../componentes/Contenido";
import BFantasma from "../componentes/BFantasma";

const servicios = () => {

    return(
        <div className="App">
        <Cabeza />      
        <BFantasmas nombre="Servicios" nombre2="Ayuda" nombre3="Registro"/>              
        <body id="home">
            <h1>Usuarios</h1>  
            <div className="classbotones">                              
                <BFantasma nombre="Registro de Carreras"/>              
                <BFantasma nombre="Historial del Usuario"/> 
            </div>   

            <hr></hr>

            <h1>Administradores</h1> 
            <div className="classbotones">

                <BFantasma nombre="Registro de Carreras"/> 
                <BFantasma nombre="Reportes"/> 
                <BFantasma nombre="EdiciÃ³n De Datos"/>                
            </div>       

        </body> 
        <Pie />
    </div>

    );

}

export default servicios;
